import { GET_USER, ADD_USER, DELETE_USER } from '../actions/types'

const initialState = {
    user: {}
}

export default function(state = initialState, action) {
    switch(action.type) {
        case GET_USER:
            return {
                ...state
            }
        case ADD_USER:
            return {
                ...state
            }
        case DELETE_USER:
            return {
                ...state
            }
        default:
            return {
                ...state
            }
    }
}
